script: |
  super -f text -I q2195.spq | sort > q2195.out

inputs:
  - name: q2195.spq
    data: |
      SELECT + + col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col0 NOT BETWEEN - - 38 * - + col0 AND + + col0 + + + col1;
  - name: tab2

outputs:
  - name: q2195.out
    data: |
      51
      67
      77
